import React from 'react';
import ChatHallContainer from '../containers/common/ChatHallContainer';
import HeaderContainer from '../containers/common/HeaderContainer';

const MainPage = () => {
  return (
    <>
      <HeaderContainer />
      <ChatHallContainer />
    </>
  );
};

export default MainPage;
